import React from 'react'
import SignIn from "../components/SignIn"
import styled from "styled-components"

const StyledDiv = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
`

const Login = () => {
  return (
    <StyledDiv>
        <h3>Sign In</h3>
        <SignIn/>
    </StyledDiv>
  )
}

export default Login
